/* LiveTester Stats */

// The LiveTester Stats functions to measure and return the values for given probabilities. So instead of aiming towards a % win, you can see 
// the % probability for the % move. It is created with the concept of a profit is profit, no matter the size. Eliminating the risk of loss, will increase the
// profitability in the long run.
// Weighting risks vs chance might put your trading at a better win rate.
// The LiveTester will also allow you to set a minimum profit and allow a 'Take Position' on any chart a valid 'Take Position' event occurs.

//- - - - - - - - - - - - - - - - - - - 

