variable.minProfit = 0.5            // Measured in full value % - 0.5 is 0.5%
variable.minProbability = 90        // Measured in full value % - 90 is 90%
variable.rewardRatioValue = 1.5     // Set your Reward to Risk ratio by editing 
variable.riskRatioValue = 1         // the values for the variables

variable.riskToReward = variable.rewardRatioValue / variable.riskRatioValue

