    if (variable.livetesterStats === 'Off' && ema.ema03 > ema.ema05 && ema.previous.ema03 < ema.previous.ema05) {
        // Defining values to keep track on and use for calculations
        variable.livetesterStats = 'On'
        if (variable.entryIndex !== undefined) {
            variable.previousEntryIndex = variable.entryIndex
        }
        variable.entryIndex = variable.candleIndex
    }

    // Define exit in the IF-statement
    if (variable.livetesterStats === 'On' && ema.ema03 < ema.ema05 && ema.previous.ema03 > ema.previous.ema05) {
        // Defining values to keep track on and use for calulations
        variable.livetesterStats = 'Off'
        variable.exitIndex = variable.candleIndex
    }
}
//- - - - - - - - - - - - - - - - - - - 

// Stats Tracker section

if (variable.livetesterStats === 'On') {

    if (variable.entryIndex === variable.candleIndex) {
