        variable.savedPosition.push(variable.entryTimestamp)

        if (variable.bullOption === 1) {
            if (variable.previousBullEntry === undefined) {
                variable.previousBullEntry = variable.candleIndex
            }
            variable.bullEntry = variable.candleIndex
            variable.bullTradeToTrade = variable.bullEntry - variable.previousBullEntry

            variable.savedBullTradeToTrade.push(variable.bullTradeToTrade)
            if (variable.savedBullTradeToTrade.length > variable.arrayLength) {
                variable.savedBullTradeToTrade.splice(0,1)
            }

            variable.previousBullEntry = variable.bullEntry
        }

        if (variable.bearOption === 1) {
            if (variable.previousBearEntry === undefined) {
                variable.previousBearEntry = variable.candleIndex
            }
            variable.bearEntry = variable.candleIndex
            variable.bearTradeToTrade = variable.bearEntry - variable.previousBearEntry

