    variable.savedPosition.push(variable.bullOption, variable.bearOption, variable.entryRate, variable.entryPos, variable.pMaxUp, variable.pMaxUpRate, variable.pMaxUpPos, variable.pMaxDown, variable.pMaxDownRate, variable.pMaxDownPos, candle.close, variable.position)
}

if (variable.candleIndex === variable.exitIndex+1) {

    variable.minProbabilityRateUp = variable.minToMaxUp[Math.round(variable.minToMaxUp.length * (1 - (variable.minProbability / 100)))]
    variable.weightedProbabilityUp = wmaProbability(variable.savedMaxUp, variable.minProbabilityRateUp)

    variable.minProbabilityRateDown = variable.minToMaxDown[Math.round(variable.minToMaxUp.length * (1 - (variable.minProbability / 100)))]
    variable.weightedProbabilityDown = wmaProbability(variable.savedMaxDown, variable.minProbabilityRateDown)

    if (variable.minProbabilityRateUp > variable.minProfit && (variable.minProbabilityRateUp / variable.minProbabilityRateDown) > variable.riskToReward) {
