// This function sets the array length linearly to what timeframe it's run on
function arrLength() {
    if (system.timeFrame < 3600000) {
        let x0 = 60000 // 01-min
        let y0 = 42 // At one min, we will save the last 42 trades
        let x1 = 3600000 // 01-hs
        let y1 = 12 // At one hour, we will save the last 12 trades

        let x = system.timeFrame  // This is the current time frame being calculated
        y = (x - x0) * (y1 - y0) / (x1 - x0) + y0
    }
    else {
        let x0 = 3600000 // 01-hs
        let y0 = 12 // At one hour, we will save the last 12 trades
        let x1 = system.ONE_DAY_IN_MILISECONDS
        let y1 = 3 // At one day, we will save the last 4 trades

        let x = system.timeFrame  // This is the current time frame being calculated
        y = (x - x0) * (y1 - y0) / (x1 - x0) + y0
    }
    return Math.round(y)
}

// WMA for Value
function wmaValue(src) {
    let sum = 0
    let totalWeight = 0
    for (i = 0; i < src.length; i++) {
        if (i === 0) {
            weight = 1
        }
        else {
            weight = weight + weight
        }
        sum = sum + (src[i] * weight)
        totalWeight = totalWeight + weight
    }
    let value = sum / totalWeight
    return value
}

// WMA for Probability
function wmaProbability(src, value) {
    let sumTrue = 0
    let sumTotal = 0
    for (i = 0; i < src.length; i++) {
        weight = i + 1
        if (src[i] > value) {
            sumTrue = sumTrue + weight
        }
        sumTotal = sumTotal + weight
    }
    let probability = sumTrue / sumTotal
    return probability
}

function copySorted(arr) {
    return arr.slice().sort((a,b) => a-b)
}

